// HasBannerItem applies the HasEdge predicate on the "banner_item" edge.
func HasBannerItem() predicate.Banner {
	return predicate.Banner(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(BannerItemTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, BannerItemTable, BannerItemColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasBannerItemWith applies the HasEdge predicate on the "banner_item" edge with a given conditions (other predicates).
func HasBannerItemWith(preds ...predicate.BannerItem) predicate.Banner {
	return predicate.Banner(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(BannerItemInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, BannerItemTable, BannerItemColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Banner) predicate.Banner {
	return predicate.Banner(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Banner) predicate.Banner {
	return predicate.Banner(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Banner) predicate.Banner {
	return predicate.Banner(func(s *sql.Selector) {
		p(s.Not())
	})
}
